import React, { useEffect, useState } from 'react';
import '../css/App.css';
import { observer } from 'mobx-react';
import authStore from '../mobX/AuthStore';

const App = observer(() => {
  const [userName, setUserName] = useState(authStore.user.name);

  useEffect(() => {
    console.log(userName);
  }, [userName]);

  return (
    <>
      <h1>{userName}</h1>
    </>
  );
});

export default App;
